#include "tdb/graphics.h"

// reads lines from a ppm file. if a line starts with a # it is ignored.
std::pair<std::string, size_t> _ppm_read_header_line_from_buffer(const uint8_t* p, size_t len)
{
    auto read_head = p;

    while(true) {
        ++read_head;
        if((read_head - p) > len)
            throw std::runtime_error( "Invalid ppm buffer." );

        if(*read_head == '\r' || *read_head == '\n')
        {
            auto output = std::string((char*)p, (read_head-p));

            ++read_head;
            if(*read_head == '\r' || *read_head == '\n')
                ++read_head;
            
            return make_pair(output, (read_head-p));
        }
    }
}

std::shared_ptr<std::vector<uint8_t>> ppm_buffer_to_argb(const uint8_t* p,
                                                         size_t len,
                                                         uint32_t& width,
                                                         uint32_t& height,
                                                         uint32_t& colorMax)
{
    std::shared_ptr<std::vector<uint8_t>> pixels;

    auto read_head = p;

    auto sig = _ppm_read_header_line_from_buffer(read_head, len);
    std::string line = sig.first;
    read_head += sig.second;
    len -= sig.second;

    if( line != "P6" )
        throw std::runtime_error( "Invalid signature in ppm file." );

    auto wh = _ppm_read_header_line_from_buffer(read_head, len);

    line = wh.first;
    read_head += wh.second;
    len -= wh.second;

    size_t spaceIndex = line.find(" ");
    if( spaceIndex == std::string::npos )
        throw std::runtime_error( "Invalid ppm file. Cannot parse width." );
    if( (line.length() - spaceIndex) <= 1 )
    throw std::runtime_error( "Invalid ppm file. Cannot parse height." );

    width = stoul( line.substr( 0, spaceIndex ) );
    if( width > 16384 )
        throw std::runtime_error("ppm too wide.");

    height = stoul( line.substr( spaceIndex+1 ) );
    if( height > 16384 )
        throw std::runtime_error("ppm too tall.");

    auto col = _ppm_read_header_line_from_buffer(read_head, len);
    line = col.first;
    read_head += col.second;
    len -= col.second;

    colorMax = stoul( line );

    pixels = std::make_shared<std::vector<uint8_t>>( width * 4 * height );

    auto dst = &(*pixels)[0];

    if(colorMax <= 255)
    {
        memcpy(dst, read_head, len);
    }
    else
    {
        for(int i = 0; i < height; ++i)
        {
            for(int ii = 0; ii < width; ++ii)
            {
                uint16_t val = *(uint16_t*)read_head;
                read_head += sizeof(uint16_t);

                *dst = 255;
                ++dst;

                *dst = (uint8_t)((((double)val) / 65535) * 255);
                ++dst;

                val = *(uint16_t*)read_head;
                read_head += sizeof(uint16_t);

                *dst = (uint8_t)((((double)val) / 65535) * 255);
                ++dst;

                val = *(uint16_t*)read_head;
                read_head += sizeof(uint16_t);

                *dst = (uint8_t)((((double)val) / 65535) * 255);
                ++dst;
            }
        }
    }

    return pixels;
}

void argb_to_ppm_file(const std::string& fileName,
                      const std::shared_ptr<std::vector<uint8_t>> pixels,
                      uint32_t width,
                      uint32_t height)
{
    FILE* outFile = fopen( fileName.c_str(), "w+b" );
    if( !outFile )
        throw std::runtime_error( "Unable to open ppm file." );

    try
    {
        fprintf( outFile, "P6\n" );
        fprintf( outFile, "%d %d\n", (int)width, (int)height );
        fprintf( outFile, "255\n" );

        size_t numColorComponents = pixels->size();
        if( (numColorComponents % 4) != 0 )
            throw std::runtime_error( "Size of pixels buffer should be multiple of 4!" );

        auto src = &(*pixels)[0];

        size_t numPixels = numColorComponents / 4;

        while( numPixels > 0 )
        {
            size_t itemsWritten = fwrite( src+1, 1, 3, outFile );
            if( itemsWritten > 0 )
            {
                src+=4;
                --numPixels;
            }
        }

        fclose( outFile );
    }
    catch(...)
    {
        if( outFile )
            fclose( outFile );
        throw;
    }
}

