void blit(std::shared_ptr<std::vector<uint8_t>> dest_pixels,
          uint32_t dest_width,
          uint32_t dest_height,
          uint32_t dest_x,
          uint32_t dest_y,
          std::shared_ptr<std::vector<uint8_t>> src_pixels,
          uint32_t src_width,
          uint32_t src_height,
          uint32_t src_x,
          uint32_t src_y,
          uint32_t width,
          uint32_t height)
{
    uint8_t* src = &(*src_pixels)[0] + (src_y * (src_width * 4)) + (src_x * 4);
    uint8_t* dst = &(*dest_pixels)[0] + (dest_y * (dest_width*4)) + (dest_x * 4);

    for(int i = 0; i < height; ++i)
    {
        memcpy(dst, src, (width*4));
        dst += dest_width * 4;
        src += src_width * 4;
    }
}

void render_text(std::shared_ptr<std::vector<uint8_t>> pixels,
                 uint32_t width,
                 uint32_t height, 
                 const char* msg, 
                 int x, 
                 int y)
{
    while(*msg != 0)
    {
        uint32_t lw, lh, colorMax;
        auto char_buffer = ppm_buffer_to_argb(letters[*msg-48],
                                              letters_sizes[*msg-48],
                                              lw,
                                              lh,
                                              colorMax);
        blit(pixels,
             width,
             height,
             x,
             y,
             char_buffer,
             lw,
             lh,
             0,
             0,
             lw,
             lh);

        x += lw;

        ++msg;
    }
}

void draw_point(std::shared_ptr<std::vector<uint8_t>> input,
                uint32_t w,
                uint32_t h,
                int x,
                int y,
                uint8_t r,
                uint8_t g,
                uint8_t b)
{
    auto pixel = &(*input)[0] + ((x * 4) + (y * (w*4)));
    *(pixel+0) = 255;
    *(pixel+1) = r;
    *(pixel+2) = g;
    *(pixel+3) = b;
}

void trace_line( uint32_t w, uint32_t h, int x1, int y1, int x2, int y2, std::function<void(int,int)> step, int inc=1 )
{
    int tmpX = 0, tmpY = 0;

    int dx = abs(x2 - x1);
    int dy = abs(y2 - y1);

    if( dx > dy )
    {
        // we're going to increment x below, so make sure x1 < x2... if its not, swap em...
        if( x1 > x2 )
        {
            tmpX = x1;
            tmpY = y1;
            x1 = x2;
            y1 = y2;
            x2 = tmpX;
            y2 = tmpY;
        }

        // more change in horizontal direction, so we iterate along x and calculate y at each point...
        for( int x = x1; x < x2; x+=inc )
        {
            int y = (y2>y1) ? y1 + dy * (((float)x - x1) / dx) : y1 - dy * (((float)x - x1) / dx);
            step( x, y );
        }
    }
    else
    {
        // we're going to increment y below, so make sure y1 < y2... If its not, swap em...
        if( y1 > y2 )
        {
            tmpX = x1;
            tmpY = y1;
            x1 = x2;
            y1 = y2;
            x2 = tmpX;
            y2 = tmpY;
        }

        // more change in vertical direction, so we iterate along y and calculate x at each point...
        for( int y = y1; y < y2; y+=inc )
        {
            int x = (x2>x1) ? x1 + dx * (((float)y - y1) / dy) : x1 - dx * (((float)y - y1) / dy);
            step( x, y );
        }
    }
}

void draw_line(std::shared_ptr<std::vector<uint8_t>> input,
               uint32_t w,
               uint32_t h,
               int x1,
               int y1,
               int x2,
               int y2,
               uint8_t r,
               uint8_t g,
               uint8_t b)
{
    trace_line(w, h, x1, y1, x2, y2, [&](int x, int y) {
        draw_point(input, w, h, x, y, r, g, b);
    });
}

void draw_line_rect(std::shared_ptr<std::vector<uint8_t>> input,
                    uint32_t w,
                    uint32_t h,
                    int x,
                    int y,
                    int rect_w,
                    int rect_h,
                    uint8_t r,
                    uint8_t g,
                    uint8_t b)
{
    draw_line(input, w, h, x, y, x+rect_w, y, r, g, b);
    draw_line(input, w, h, x+rect_w, y, x+rect_w, y+rect_h, r, g, b);
    draw_line(input, w, h, x, y, x, y+rect_h, r, g, b);
    draw_line(input, w, h, x, y+rect_h, x+rect_w, y+rect_h, r, g, b);
}
